import React from "react";

function Student({stdName,setStdName,stdId,setStdId }) {
  const handleNameChange = (e) => {
    setStdName(e.target.value);
    console.log(stdName);
  }
  const handleIdChange = (e) => {
    setStdId(e.target.value);
    console.log(stdId);
  }
  return(
    <div>
      <label htmlFor="stdName">Student : 
        <input type="text" name="stdName" onChange={(e) => handleNameChange(e)} value={stdName}/>
      </label>
      <label htmlFor="stdId">Register Number : 
        <input type="text" name="stdId" onChange={(e) => handleIdChange(e)} value={stdId}/>
      </label>
    </div>
  )
}


export default Student;
